const medal = {
    gold: require('../../assets/medalGold.png'),
    silver: require('../../assets/silverMedal.png'),
    bronze: require('../../assets/bronzeMedal.jpg')
}

let cards = [
    {
        src: 'fontawesome',
        name: 'heart',
        color: 'red'
    },
    {
        src: 'entypo',
        name: 'feather',
        color: '#7d4b12'
