        color: '#5f5f5f'
    },
    {
        src: 'fontawesome',
        name: 'github',
        color: '#24292e'
    },
    {
        src: 'fontawesome',
        name: 'skype',
        color: '#1686D9'
    },
    {
        src: 'fontawesome',
        name: 'send',
        color: '#1c7cd6'
    },
    {
        src: 'ionicons',
        name: 'ios-magnet',
        color: '#d61c1c'
    },
    {
        src: 'ionicons',
        name: 'logo-facebook',
        color: '#3C5B9B'
    }

];

let sources = {
    'fontawesome': FontAwesome,
    'entypo': Entypo,
    'ionicons': Ionicons
};

export { medal, cards, sources }
